(255, 96, 'title', 'This Side of Paradise'),
(256, 96, 'synopsis', 'This Side of Paradise (1920) is a semi-autobiographical novel by American author F. Scott Fitzgerald. Considered a quintessential work of the Jazz Age, the novel follows Amory, an impulsive young man who squanders his college education at Princeton and recklessly falls in love with a girl from the South.'),
(257, 96, '_edit_lock', '1665389241:1'),
(259, 101, '_edit_last', '1'),
(260, 101, '_thumbnail_id', '67'),
(261, 101, 'title', 'The Curious Case of Benjamin Button'),
(262, 101, 'synopsis', 'This stunning graphic novel adaptation illustrates Benjamin Button\'s many adventures: He falls in love, starts a family, and runs a successful business. In his later years, he goes to war and attends Harvard University. As an old man, he resembles a newborn baby and returns to the care of a nurse.'),
(263, 101, '_edit_lock', '1665388975:1'),
(264, 41, '_thumbnail_id', '38'),
(265, 102, '_edit_last', '1'),
(266, 102, '_edit_lock', '1665388736:1'),
(267, 102, 'title', 'Tender is the Night'),
(268, 102, 'synopsis', 'Tender Is the Night, semiautobiographical novel by F. Scott Fitzgerald, published in 1934. It is the story of a psychiatrist who marries one of his patients; as she slowly recovers, she exhausts his vitality until he is, in Fitzgerald\'s words, un homme puis (a used-up man)'),
(269, 102, '_thumbnail_id', '68'),
(270, 103, '_edit_last', '1'),
(271, 103, '_edit_lock', '1665388814:1'),
(272, 103, '_thumbnail_id', '69'),
(273, 103, 'title', 'The Beautiful and the Damned'),
(274, 103, 'synopsis', 'The Beautiful and Damned, F. Scott Fitzgerald\'s second novel, tells the story of Anthony Patch, a 1920s socialite and presumptive heir to a tycoon\'s fortune. Anthony and his wife Gloria are young and gorgeous, rich and leisured, and dedicate their lives to the reckless pursuit of happiness.'),
(275, 105, '_edit_last', '1'),
(276, 105, '_thumbnail_id', '70'),
(277, 105, 'title', 'Tales of the Jazz Age'),
(278, 105, 'synopsis', 'Tales of the Jazz Age is a collection of eleven short stories by F. Scott Fitzgerald. Divided into three separate parts, according to subject matter'),
(279, 105, '_edit_lock', '1665388628:1'),
(280, 106, '_edit_last', '1'),
(281, 106, '_edit_lock', '1665388888:1'),
(282, 106, '_thumbnail_id', '71'),
(283, 106, 'title', 'The Crack Up'),
(284, 106, 'synopsis', 'The essay The Crack-Up is an elaborate description and analysis of the mental breakdown the author experienced and the depths of its causes. After a life of struggling to succeed and failing multiple times, he suddenly reconsiders why he needs to succeed at all and whether it is what he really wants.'),
(285, 107, '_edit_last', '1'),
(286, 107, '_edit_lock', '1665425000:1'),
(287, 107, '_thumbnail_id', '73'),
(288, 107, 'title', 'The Last Tycoon'),
(289, 107, 'synopsis', 'The Last Tycoon by F. Scott Fitzgerald is a novel about a Hollywood producer who finds himself not only struggling to find love and success in a world of cut-throats, but who is in the ultimate struggle for his own life. The Last Tycoon is Fitzgerald\'s final work, a novel he was working on at the time of his death.'),
