(2, 1, '2022-09-28 16:56:19', '2022-09-28 16:56:19', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:image {\"align\":\"center\",\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/fscotty.png\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>F. Scott Fitzgerald</strong>, (born Sept. 24, 1896, St. Paul, Minn., U.S.died Dec. 21, 1940, Hollywood, Calif.), U.S. novelist and short-story writer. Fitzgerald attended Princeton University but dropped out with bad grades. In 1920 he married Zelda Sayre (190048), daughter of a respected Alabama judge. His works, including the early novels&nbsp;<em>This Side of Paradise</em>&nbsp;(1920) and&nbsp;<em>The Beautiful and Damned</em>&nbsp;(1922) and the story collections&nbsp;<em>Tales of the Jazz Age</em>&nbsp;(1922) and&nbsp;<em>All the Sad Young Men</em>&nbsp;(1926), capture the Jazz Ages vulgarity and dazzling promise. His brilliant&nbsp;<em>The Great Gatsby</em>&nbsp;(1925; film, 1926, 1949, 1974; TV movie 2001), a story of American wealth and corruption, was eventually acclaimed one of the centurys greatest novels. In 1924 Scott and Zelda became part of the expatriate community on the French Riviera, the setting of&nbsp;<em>Tender Is the Night</em>&nbsp;(1934; film, 1962). His fame and prosperity proved disorienting to them both, and he became seriously alcoholic. Zelda never fully recovered from a mental breakdown in 1932 and spent most of her remaining years in a sanitarium. In 1937 Scott moved to Hollywood to write film scripts; the experience inspired the unfinished&nbsp;<em>The Last Tycoon</em>&nbsp;(1941; film, 1976). He died of a heart attack at age 44.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:image {\"id\":82,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/time.jpg\" alt=\"\" class=\"wp-image-82\"/></figure>\n<!-- /wp:image -->', 'Author Bio', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2022-10-05 13:27:11', '2022-10-05 13:27:11', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?page_id=2', 0, 'page', '', 0),
(3, 1, '2022-09-28 16:56:19', '2022-09-28 16:56:19', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: https://gschroeder7.bitlampsites.com/wpd/final.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->', 'Privacy Policy', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2022-09-28 16:56:19', '2022-09-28 16:56:19', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?page_id=3', 0, 'page', '', 0),
