(85, 1, '2022-10-05 08:31:14', '2022-10-05 08:31:14', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:image {\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/fscotty.png\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>F. Scott Fitzgerald</strong>, (born Sept. 24, 1896, St. Paul, Minn., U.S.died Dec. 21, 1940, Hollywood, Calif.), U.S. novelist and short-story writer. Fitzgerald attended Princeton University but dropped out with bad grades. In 1920 he married Zelda Sayre (190048), daughter of a respected Alabama judge. His works, including the early novels&nbsp;<em>This Side of Paradise</em>&nbsp;(1920) and&nbsp;<em>The Beautiful and Damned</em>&nbsp;(1922) and the story collections&nbsp;<em>Tales of the Jazz Age</em>&nbsp;(1922) and&nbsp;<em>All the Sad Young Men</em>&nbsp;(1926), capture the Jazz Ages vulgarity and dazzling promise. His brilliant&nbsp;<em>The Great Gatsby</em>&nbsp;(1925; film, 1926, 1949, 1974; TV movie 2001), a story of American wealth and corruption, was eventually acclaimed one of the centurys greatest novels. In 1924 Scott and Zelda became part of the expatriate community on the French Riviera, the setting of&nbsp;<em>Tender Is the Night</em>&nbsp;(1934; film, 1962). His fame and prosperity proved disorienting to them both, and he became seriously alcoholic. Zelda never fully recovered from a mental breakdown in 1932 and spent most of her remaining years in a sanitarium. In 1937 Scott moved to Hollywood to write film scripts; the experience inspired the unfinished&nbsp;<em>The Last Tycoon</em>&nbsp;(1941; film, 1976). He died of a heart attack at age 44.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:image {\"id\":82,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/time.jpg\" alt=\"\" class=\"wp-image-82\"/></figure>\n<!-- /wp:image -->', 'Author Bio', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2022-10-05 08:31:14', '2022-10-05 08:31:14', '', 2, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=85', 0, 'revision', '', 0),
(86, 1, '2022-10-05 08:31:33', '2022-10-05 08:31:33', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:image {\"align\":\"center\",\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/fscotty.png\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>F. Scott Fitzgerald</strong>, (born Sept. 24, 1896, St. Paul, Minn., U.S.died Dec. 21, 1940, Hollywood, Calif.), U.S. novelist and short-story writer. Fitzgerald attended Princeton University but dropped out with bad grades. In 1920 he married Zelda Sayre (190048), daughter of a respected Alabama judge. His works, including the early novels&nbsp;<em>This Side of Paradise</em>&nbsp;(1920) and&nbsp;<em>The Beautiful and Damned</em>&nbsp;(1922) and the story collections&nbsp;<em>Tales of the Jazz Age</em>&nbsp;(1922) and&nbsp;<em>All the Sad Young Men</em>&nbsp;(1926), capture the Jazz Ages vulgarity and dazzling promise. His brilliant&nbsp;<em>The Great Gatsby</em>&nbsp;(1925; film, 1926, 1949, 1974; TV movie 2001), a story of American wealth and corruption, was eventually acclaimed one of the centurys greatest novels. In 1924 Scott and Zelda became part of the expatriate community on the French Riviera, the setting of&nbsp;<em>Tender Is the Night</em>&nbsp;(1934; film, 1962). His fame and prosperity proved disorienting to them both, and he became seriously alcoholic. Zelda never fully recovered from a mental breakdown in 1932 and spent most of her remaining years in a sanitarium. In 1937 Scott moved to Hollywood to write film scripts; the experience inspired the unfinished&nbsp;<em>The Last Tycoon</em>&nbsp;(1941; film, 1976). He died of a heart attack at age 44.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:image {\"id\":82,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/time.jpg\" alt=\"\" class=\"wp-image-82\"/></figure>\n<!-- /wp:image -->', 'Author Bio', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2022-10-05 08:31:33', '2022-10-05 08:31:33', '', 2, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=86', 0, 'revision', '', 0),
