(96, 1, '2022-10-05 11:47:42', '2022-10-05 11:47:42', 'This Side of Paradise is the debut novel by F. Scott Fitzgerald, published in 1920. The book examines the lives and morality of postWorld War I youth. Its protagonist Amory Blaine is an attractive student at Princeton University who dabbles in literature. The novel explores the theme of love warped by greed and status seeking, and takes its title from a line of Rupert Brooke\'s poem Tiare Tahiti. The novel famously helped F. Scott Fitzgerald gain Zelda Sayre\'s hand in marriage; its publication was her condition of acceptance.', 'This Side of Paradise', '', 'publish', 'closed', 'closed', '', 'paradise-2', '', '', '2022-10-10 08:09:40', '2022-10-10 08:09:40', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=96', 0, 'book', '', 0),
