(101, 1, '2022-10-05 12:24:14', '2022-10-05 12:24:14', 'In 1860 Baltimore, Benjamin is born with the physical appearance of a 70-year-old man, already capable of speech. At five, Benjamin is sent to kindergarten but has to be quickly withdrawn after he repeatedly falls asleep during child activities. When Benjamin turns 12, the Button family realizes that their son is aging backwards', 'The Curious Case of Benjamin Button', '', 'publish', 'closed', 'closed', '', 'button-2', '', '', '2022-10-10 08:05:08', '2022-10-10 08:05:08', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=101', 0, 'book', '', 0),
(102, 1, '2022-10-05 12:27:55', '2022-10-05 12:27:55', 'F. Scott Fitzgerald wrote in a friend\'s copy of<span class=\"a-text-italic\">Tender Is the Night,</span>\"If you liked<span class=\"a-text-italic\">The Great Gatsby,</span>for God\'s sake read this.<span class=\"a-text-italic\">Gatsby</span>was a tour de force but this is a confession of faith.\" Set in the South of France in the decade after World War I,<span class=\"a-text-italic\">Tender Is the Night</span>is the story of a brilliant and magnetic psychiatrist named Dick Diver; the bewitching, wealthy, and dangerously unstable mental patient, Nicole, who becomes his wife; and the beautiful, harrowing ten-year pas de deux they act out along the border between sanity and madness.\r\nIn<span class=\"a-text-italic\">Tender Is the Night,</span>Fitzgerald deliberately set out to write the most ambitious and far-reaching novel of his career, experimenting radically with narrative conventions of chronology and point of view and drawing on early breakthroughs in psychiatry to enrich his account of the makeup and breakdown of character and culture.', 'Tender is the Night', '', 'publish', 'closed', 'closed', '', 'tender-2', '', '', '2022-10-10 08:01:05', '2022-10-10 08:01:05', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=102', 0, 'book', '', 0),
(103, 1, '2022-10-05 12:29:42', '2022-10-05 12:29:42', 'The Beautiful and Damned, F. Scott Fitzgerald\'s second novel, tells the story of Anthony Patch, a 1920s socialite and presumptive heir to a tycoon\'s fortune. Anthony and his wife Gloria are young and gorgeous, rich and leisured, and dedicate their lives to the reckless pursuit of happiness. But this intimate story turns tragic, as their marriage disintegrates under the weight of their expectations, dissipation, jealousy and aimlessness.', 'The Beautiful and The Damned', '', 'publish', 'closed', 'closed', '', 'beautiful', '', '', '2022-10-10 08:02:34', '2022-10-10 08:02:34', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=103', 0, 'book', '', 0),
(105, 1, '2022-10-05 12:31:08', '2022-10-05 12:31:08', 'Tales of the Jazz Age (1922) is a collection of eleven short stories by F. Scott Fitzgerald. Divided into three separate parts, according to subject matter, it includes one of his better-known short stories, \"The Curious Case of Benjamin Button\". Several of the stories had also been published earlier, independently, in either The Metropolitan, Saturday Evening Post, Smart Set, Collier\'s, Chicago Tribune, or Vanity Fair.', 'Tales of the Jazz Age', '', 'publish', 'closed', 'closed', '', 'jazz-2', '', '', '2022-10-10 07:59:29', '2022-10-10 07:59:29', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=105', 0, 'book', '', 0),
(106, 1, '2022-10-05 12:32:24', '2022-10-05 12:32:24', '<span class=\"a-text-italic\">The Crack-Up</span>tells the story of Fitzgerald\'s sudden descent at the age of thirty-nine from glamorous success to empty despair, and his determined recovery. Compiled and edited by Edmund Wilson shortly after F. Scott Fitzgerald\'s death, this revealing collection of his essaysas well as letters to and from Gertrude Stein, Edith Wharton, T.S. Eliot, John Dos Passostells of a man with charm and talent to burn, whose gaiety and genius made him a living symbol of the Jazz Age, and whose recklessness brought him grief and loss.', 'The Crack Up', '', 'publish', 'closed', 'closed', '', 'crack-2', '', '', '2022-10-10 08:03:48', '2022-10-10 08:03:48', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=106', 0, 'book', '', 0),
(107, 1, '2022-10-05 12:33:35', '2022-10-05 12:33:35', '<span class=\"a-text-italic\">The Last Tycoon,</span>edited by the preeminent Fitzgerald scholar Matthew J. Bruccoli, is a restoration of the author\'s phrases, words, and images that were excised from the 1940 edition, giving new luster to an unfinished literary masterpiece. It is the story of the young Hollywood mogul Monroe Stahr, who was inspired by the life of boy-genius Irving Thalberg, and is an expos of the studio system in its heyday.', 'The Last Tycoon', '', 'publish', 'closed', 'closed', '', 'tycoon-2', '', '', '2022-10-10 08:08:31', '2022-10-10 08:08:31', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=book&#038;p=107', 0, 'book', '', 0),
