(140, 1, '2022-10-10 05:41:36', '2022-10-10 05:41:36', 'The most obvious theme of<em>The Great Gatsby</em>is the corrupt nature of the wealthy. It\'s ironic how the cynical author himself did not practice what he preached; if the point of the novel was to illustrate money\'s ill effects, wouldn\'t you be prudent in your expenditures?\r\n\r\nMoney and fame continued to haunt Fitzgerald\'s dreams. It could have been the reason he despised it so much and dedicated a whole novel to bashing it.', 'Why The Great Gatsby is Overaerated', '', 'publish', 'closed', 'closed', '', 'why-the-great-gatsby-is-overaerated', '', '', '2022-10-10 09:04:45', '2022-10-10 09:04:45', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=review&#038;p=140', 0, 'review', '', 0),
