(157, 1, '2022-10-10 07:57:00', '2022-10-10 07:57:00', '<!-- wp:image {\"id\":154,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/banner-3-1024x612.jpg\" alt=\"\" class=\"wp-image-154\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This website is dedicated to commemorating one of the best American authors. This website contains a bio, a works page, and a contact page. Book reviews are also dotted around the website, feel free to contact us and leave suggestions! </p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '151-revision-v1', '', '', '2022-10-10 07:57:00', '2022-10-10 07:57:00', '', 151, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=157', 0, 'revision', '', 0),
(158, 1, '2022-10-10 08:00:38', '2022-10-10 08:00:38', 'F. Scott Fitzgerald wrote in a friend\'s copy of<span class=\"a-text-italic\">Tender Is the Night,</span>\"If you liked<span class=\"a-text-italic\">The Great Gatsby,</span>for God\'s sake read this.<span class=\"a-text-italic\">Gatsby</span>was a tour de force but this is a confession of faith.\" Set in the South of France in the decade after World War I,<span class=\"a-text-italic\">Tender Is the Night</span>is the story of a brilliant and magnetic psychiatrist named Dick Diver; the bewitching, wealthy, and dangerously unstable mental patient, Nicole, who becomes his wife; and the beautiful, harrowing ten-year pas de deux they act out along the border between sanity and madness.\nIn<span class=\"a-text-italic\">Tender Is the Night,</span>Fitzgerald deliberately set out to write the most ambitious and far-reaching novel of his career, experimenting radically with narrative conventions of chronology and point of view and drawing on early breakthroughs in psychiatry to enrich his account of the makeup and breakdown of character and culture.', 'Tender is the Night', '', 'inherit', 'closed', 'closed', '', '102-autosave-v1', '', '', '2022-10-10 08:00:38', '2022-10-10 08:00:38', '', 102, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=158', 0, 'revision', '', 0),
(159, 1, '2022-10-10 08:03:43', '2022-10-10 08:03:43', '<span class=\"a-text-italic\">The Crack-Up</span>tells the story of Fitzgerald\'s sudden descent at the age of thirty-nine from glamorous success to empty despair, and his determined recovery. Compiled and edited by Edmund Wilson shortly after F. Scott Fitzgerald\'s death, this revealing collection of his essaysas well as letters to and from Gertrude Stein, Edith Wharton, T.S. Eliot, John Dos Passostells of a man with charm and talent to burn, whose gaiety and genius made him a living symbol of the Jazz Age, and whose recklessness brought him grief and loss.', 'The Crack Up', '', 'inherit', 'closed', 'closed', '', '106-autosave-v1', '', '', '2022-10-10 08:03:43', '2022-10-10 08:03:43', '', 106, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=159', 0, 'revision', '', 0),
(160, 1, '2022-10-10 08:06:25', '2022-10-10 08:06:25', 'The Great Gatsby is a 1925 novel by American writer F. Scott Fitzgerald. Set in the Jazz Age on Long Island, the novel depicts narrator Nick Carraway\'s interactions with mysterious millionaire Jay Gatsby and Gatsby\'s obsession to reunite with his former lover, Daisy Buchanan.', 'The Great Gatsby', '', 'inherit', 'closed', 'closed', '', '41-autosave-v1', '', '', '2022-10-10 08:06:25', '2022-10-10 08:06:25', '', 41, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=160', 0, 'revision', '', 0),
(163, 1, '2022-10-10 08:40:38', '2022-10-10 08:40:38', '<!-- wp:image {\"id\":154,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/banner-3-1024x612.jpg\" alt=\"\" class=\"wp-image-154\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This website is dedicated to commemorating one of the best American authors. This website contains a bio, a works page, and a contact page. Book reviews are also dotted around the website, feel free to contact us and leave suggestions! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n[review-list]\n<!-- /wp:shortcode -->', 'Home', '', 'inherit', 'closed', 'closed', '', '151-revision-v1', '', '', '2022-10-10 08:40:38', '2022-10-10 08:40:38', '', 151, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=163', 0, 'revision', '', 0),
(164, 1, '2022-10-10 08:42:33', '2022-10-10 08:42:33', '<!-- wp:image {\"id\":154,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://gschroeder7.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/banner-3-1024x612.jpg\" alt=\"\" class=\"wp-image-154\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This website is dedicated to commemorating one of the best American authors. This website contains a bio, a works page, and a contact page. Book reviews are also dotted around the website, feel free to contact us and leave suggestions! </p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '151-autosave-v1', '', '', '2022-10-10 08:42:33', '2022-10-10 08:42:33', '', 151, 'https://gschroeder7.bitlampsites.com/wpd/final/?p=164', 0, 'revision', '', 0),
(165, 1, '2022-10-10 09:21:31', '2022-10-10 09:21:31', 'Probably all this has something to do with the fact that Fitzgerald apparently cobbled together a bunch of his unpublished work in order to bring the novel to full lengthhe was rushing to get it done and published, because Zelda Sayre, the real-life Rosalind, had promised to marry him once he did; the novel was published on March 26th, 1920 and they were wed a week later, on April 3rd.', 'This side of paradise, more like, Im in paradise!', '', 'publish', 'closed', 'closed', '', 'this-side-of-paradise-more-like-im-in-paradise', '', '', '2022-10-10 09:21:31', '2022-10-10 09:21:31', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=review&#038;p=165', 0, 'review', '', 0),
(166, 1, '2022-10-10 09:22:40', '2022-10-10 09:22:40', 'I can\'t think of any writer other F. Scott Fitzgerald that has had such of a yo-yo effect on me. I thought \'Gatsby\' was the real deal, \'This Side of Paradise\' I gave up on, some of his short stories left a big impression on me, whereas, \'Tender Is the Night\' felt like a bit of a mess. I put this down to his personal life, which wasn\'t exactly plain sailing. \'The Beautiful and Damned\' sits comfortably in-between this lot, lounged in the Ritz-carlton to be precise. With a cigarette in one hand, an', 'The beautiful and the damned and me', '', 'publish', 'closed', 'closed', '', 'the-beautiful-and-the-damned-and-me', '', '', '2022-10-10 17:43:08', '2022-10-10 17:43:08', '', 0, 'https://gschroeder7.bitlampsites.com/wpd/final/?post_type=review&#038;p=166', 0, 'review', '', 0),
