INSERT INTO `wpd_final__snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES
(1, 'Make upload filenames lowercase', 'Makes sure that image and file uploads have lowercase filenames.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_filter( \'sanitize_file_name\', \'mb_strtolower\' );', 'sample, media', 'global', 10, 0, '2022-10-05 04:48:52'),
(2, 'Disable admin bar', 'Turns off the WordPress admin bar for everyone except administrators.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_action( \'wp\', function () {\n	if ( ! current_user_can( \'manage_options\' ) ) {\n		show_admin_bar( false );\n	}\n} );', 'sample, admin-bar', 'front-end', 10, 0, '2022-10-05 04:48:52'),
(3, 'Allow smilies', 'Allows smiley conversion in obscure places.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_filter( \'widget_text\', \'convert_smilies\' );\nadd_filter( \'the_title\', \'convert_smilies\' );\nadd_filter( \'wp_title\', \'convert_smilies\' );\nadd_filter( \'get_bloginfo\', \'convert_smilies\' );', 'sample', 'global', 10, 0, '2022-10-05 04:48:52'),
(4, 'Current year', 'Shortcode for inserting the current year into a post or page..\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', '<?php echo date( \'Y\' ); ?>', 'sample, dates', 'content', 10, 0, '2022-10-05 04:48:52'),
(5, 'header widg', '', 'function quadlayers_widgets_init() {\r\nregister_sidebar( array(\r\n\'name\' => \'QuadLayers Header Widget\',\r\n\'id\' => \'quadlayers-header-widget\',\r\n\'before_widget\' => \'<div class=\"ql-widget\">\',\r\n\'after_widget\' => \'</div>\',\r\n\'before_title\' => \'<h2 class=\"ql-title\">\',\r\n\'after_title\' => \'</h2>\',\r\n) );\r\n}\r\nadd_action( \'widgets_init\', \'quadlayers_widgets_init\' );', '', 'global', 10, 1, '2022-10-05 04:50:00');
